import React from "react";

const Myheader = () => {
  return (
    <div className="container">
      <div className="row">
        <div class="col-3">
          <nav class="navbar bg-light">
            <ul class="nav navbar-nav">
              <li class="nav-item">
                <a class="nav-link" href="#">
                  {" "}
                  Home{" "}
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  {" "}
                  Services{" "}
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  {" "}
                  Contact{" "}
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  {" "}
                  Blogs{" "}
                </a>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Myheader;
